Wizaplace est en forte croissance et cherche de nouveaux collaborateurs!
Nous sommes une société d'édition de logiciel basée à Lyon et comprenant une quarantaine de collaborateurs.
Notre coeur de métier est le développement de notre produit Wizaplace, un moteur de Marketplace en SaaS.
Nous développons des marketplaces pour des clients variés, de la start-up innovante au grand compte Cac40.
Nous sommes aussi une bande de technophiles curieux et sympas.
Dans le cadre d'un ambitieux projet de refonte, vous serez amené(e) à travailler avec une équipe de 14 personnes en mode Agile Scrum sur une application php7 / Symfony 4.
Missions principales:
- Développer des fonctionnalités avancées pour notre produit Wizaplace;
- Analyser les spécifications fonctionnelles, découper et estimer les tâches de développement;
- Effectuer une veille technologique avec les membres de l'équipe.
Contexte
Rattaché(e) à notre CTO Cédric et en collaboration avec le reste de la team Core, vous travaillerez sur les fonctionnalités core du service et son API Rest, avec la stack suivante (en amélioration constante) :
- PHP 7.2, Symfony 3.4 & 4
- GitHub
- PHPUnit, Behat
- Docker, MySQL, Redis, Elastic Stack, RabbitMQ
- Architecture microservices sous Kubernetes
On comptera donc sur vous pour :
- Participer à la refonte du code legacy;
- Participer à la maintenance;
- Collaborer avec les experts fonctionnels pour comprendre les besoins;
- Améliorer continuellement le code;
- Participer aux revues de code;
- Écrire des tests (unitaires et fonctionnels);
- Contribuer à notre blog technique;
- Travailler en équipe !
Votre profil :
Un candidat(e) avec au minimum 3 années d'expérience en développement back end maîtrisant les technologies suivantes :
- PHP 7
- Un framework PHP (Symfony, Laravel …)
- Des connaissances en développement d’API et tests unitaires en PHPUnit.
Les plus de ce poste
- Rejoindre un éditeur de logiciel innovant et ambitieux;
- Intégrer une équipe passionnée et technophile (tous les jeudis, présentation d'une nouvelle techno au reste de la team);
- Travailler avec des technologies nouvelles (Docker, kubernetes);
- Travailler en équipe et interagir avec tous les métiers sur place (le siège est à Lyon);
- Bonnes pratiques de code (refactoriser, revues de code, pair programming, déploiement continu, analyse de spécifications)
- Apprentissage continu: possibilité de participer à des conférences ou formations (Forum PHP, blendweb mix, conférences, salons…);
- Environnement de développement en fonction de vos habitudes (PC, portable ou fixe, …), double écran et licence PHP Storm;
- Du café et des fruits à volonté.
Poste basé à Lyon (proche de la gare de Vaise).
Salaire: A partir de 35K€ + tickets restaurant + prime kilométrique sur les moyens de transport écologique + mutuelle entièrement prise en charge par l'employeur.
Type d'emploi : CDI
Salaire : 35 000,00€ à 45 000,00€ /an
Expérience:
développeur back-end symfony 4 h/f ou similaire: 1 an (Souhaité)

