Votre mission
Le poste se compose d’un socle principal de gestion quotidienne ; une fois la gestion quotidienne maîtrisée, vous serez amené à prendre en main de nombreux projets plus techniques.
Gestion quotidienne
Assurer le fonctionnement quotidien du parc informatique (gestion des stocks, commandes, dépannage)
Administrer les outils Cloud de l’entreprise (Google Suite, Trello, Github, Slack, etc.)
Documenter et faire évoluer les processus et outils internes (arrivées / sorties, configuration des postes, visio, etc.)
Projets techniques avancés
Maintenir en conditions opérationnelles les serveurs (Debian / Linux) et équipements réseaux (Juniper, Linux) et les automatiser (ansible)
Moderniser les services bureautiques (DHCP, supervision, sécurité)
Développer les outils internes (Python/Django)
Notre engagement
Découvrez, en fonction de vos intérêts et des besoins de l’entreprise, de multiples univers techniques : réseau, système, développement web ;
Montez en compétence au contact direct d’équipes de haut niveau (en charge de l’ensemble de l’infrastructure Autolib’) ;
Soyez autonome et responsable des projets confiés — proposition de solution, implémentation, déploiement ;
Épanouissez-vous dans une ambiance à la fois sérieuse et conviviale (communication fluide, équipe jeune, cadre de travail agréable, locaux au cœur de Paris — Champs-Élysées) ;
En fonction de votre progression et de votre projet professionnel, vous pourriez rejoindre nos équipes de développement ou d’infrastructure Cloud.
Votre profil
Au-delà du diplôme ou du parcours, nous recherchons avant tout des personnes rigoureuses et curieuses.
Le poste nécessite une très bonne capacité d’organisation personnelle — vous devrez définir et mettre en œuvre les bonnes priorités pour assurer le service aux utilisateurs tout en avançant sur les projets de fond ;
Le rôle nécessite une forte autonomie, doublé d’un sens du service développé ;
Une bonne connaissance du fonctionnement de Windows est attendue, ainsi qu’une familiarité avec la ligne de commande (Mac ou Linux) ; et des bases de programmation ;
Sur cette base minimale, l’objectif sera de monter progressivement en compétences au contact des experts de l’équipe.

