Une formation supérieure en informatique, et une première expérience sur un des environnements suivants:
Java 1.7, Eclipse Kepler, JBoss EAP (Application Server) 6.4, Spring, Spring Batch, Hibernate, PostgreSQL 9.4, Maven, Jira;
Java, JDK (1.7, 1.8), Tomcat, Spring IOC, Spring MVC ; Spring Batch, Hibernate, services Web (SOAP et REST), Javascript, CSS, XML, Oracle, Eclipse, IntelliJ IDEA, GIT;
